import React, {useState} from 'react'
import { Modal } from '../../context/Modal';
import "./UpdatePage.css"
import UpdatePage from '../LogSignUpModal';

function UpdatePageModal() {
    const [showModal, setShowModal] = useState(false);

    return (
        <div className="splashPage">
        <img src="https://storage.googleapis.com/pr-newsroom-wp/1/2018/11/Spotify_Logo_CMYK_Green.png" alt="" />
            <div className="" onClick={() => setShowModal(true)}>
                Update </div>
            {showModal && (
                <Modal onClose={() => setShowModal(false)}>
                    <UpdatePageModal />
                </Modal>
            )}
        </div>
    )
}

export default UpdatePageModal;
